{ real3 normal; normal.xy = packedNormal.ag * 2.0 - 1.0; normal.z = max(1.0e-16, sqrt(1.0 - saturate(dot(normal.xy, normal.xy)))); // must scale after reconstruction of normal.z which also // mirrors UnpackNormalRGB(). This does imply normal is not returned // as a unit length vector but doesn't need it since it will get normalized after TBN transformation. // If we ever need to blend contributions with built-in shaders for URP // then we should consider using UnpackDerivativeNormalAG() instead like // HDRP does since derivatives do not use renormalization and unlike tangent space // normals allow you to blend, accumulate and scale contributions correctly. normal.xy *= scale; return normal;
